  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Lake Andes Wetland
  Management District outlines Refuge accomplishments during the 1977 calendar year.
  The report begins with an introduction to the Refuge and information about weather
  conditions, habitat conditions, land acquisition activities, and the system status.
  Construction and maintenance are also described. Habitat management is covered;
  croplands, grasslands, wetlands, forests, and easements for waterfowl management
  are discussed. The wildlife section of the report discusses endangered and threatened
  species, migratory birds, and mammals. Interpretation and recreation activities
  are outlined; topics include recreation and law enforcement. Field investigations,
  cooperative programs, items of interest, safety information, and newspaper articles
  are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
